    name VARCHAR,
    age INT,
    position VARCHAR
);

CREATE TABLE teams (
    team_id INT PRIMARY KEY,
    team_name VARCHAR,
    coach_name VARCHAR
);

CREATE TABLE matches (
    match_id INT PRIMARY KEY,
    match_date DATE,
    venue VARCHAR
);

CREATE TABLE player_stats (
    player_id INT,
    match_id INT,
    goals INT,
    assists INT,
    fouls INT
);

CREATE TABLE contracts (
    player_id INT,
    team_id INT,
    contract_start_date DATE,
    contract_end_date DATE
);

### STATEMENT

SELECT p.name, SUM(ps.goals) as total_goals FROM players p JOIN player_stats ps ON p.player_id = ps.player_id GROUP BY p.name;

